export async function get(url: string, token: string) {
  const response = await fetch(url, {
    method: "GET",
    headers: {
      "Authorization": `Bearer ${token}`
    }
  })

  return response.ok ? await response.json() : alert("Fuck");
}

export async function post(url: string, token: string) {
  const response = await fetch(url, {
    method: "POST",
    headers: {
      "Authorization": `Bearer ${token}`
    }
  })

  return response.ok ? await response.json() : alert("Fuck");
}
